import React, { useState } from 'react'

export default function DemoChild(props) {
    const [name,setName] = useState()
    const handleClick = ()=>{
        props.getdata("I am clicked")
    }
    const handleNameClick = ()=>{
        setName(name)
        props.getdata(name)
    }

  return (
    <div>
        <button className='border-2 bg-blue-900 text-white p-2 rounded-xl' onClick={handleClick}>showdata</button>
        <input type="text" name="name" id="" value="Enter Text" /> 
        <button className='border-2 bg-blue-900 text-white p-2 rounded-xl' onClick={handleNameClick}>Copy Name</button>
    </div>
  )
}
